import React, { Component } from 'react';
import './App.css';
import Top from './Main/Top';

class App extends Component {
  render() {
    return (
      <div className="App">
          <div class="row">
            <div class="col-3">col-3</div>
            <div class="col-6">col-6</div>
            <div class="col-3">col-3</div>
          </div>
      </div>
    );
  }
}

export default App;
